(20008, 572, 2179, 10, '張睿銓 - 屠馬 (Slay The Trojan Horse)', '無', '2009-07-26 00:00:00', 2000, 10, 0, 2, '(英文：張睿銓)\r\nWe’ve had enough of this melodrama\r\nSick of this bloodstained propaganda\r\nWe don’t need your laboratory panda\r\nTaiwan’s never been part of China\r\n\r\nPlease tell me, Lord, what I should do\r\nThey don’t listen when you speak the truth\r\nThose who lead try to play God for the rich and poor\r\nBut they forget the love of money is the root of all evil\r\nLoopholes spotted\r\nThe panda turns herbal and they smuggle it\r\nWelcome the Trojan horse with their arms wide open\r\nFuck the government that’s trying to drug and pimp them\r\n\r\n(華語：岳翰林)\r\n妖獸一現，禍延千年\r\n咒詛一鳴，地火萬里\r\n魂影四竄逃，怨聲殘急奔\r\n血泊枯盡恨淫淫\r\n\r\n詭詐遍野騎瘋馬\r\n罪惡滿城狂天雷\r\n吾等不憤，不為人\r\n吾等不怒，不為人\r\n\r\n咒詛已定，屠人者亡\r\n冥府開！大血滿弓刀\r\n\r\n(英文：張睿銓)\r\nWe’ve had enough of this melodrama\r\nSick of this bloodstained propaganda\r\nWe don’t need your laboratory panda\r\nTaiwan’s never been part of China\r\n\r\nProphets are killed, prophecy fulfilled\r\nSecular priests reenact the Apocalypse for real\r\nThis island forsakes the blessings of The Dalai Lama\r\n17,000 cops sent to escort a king from China\r\nThat’s when they confiscate their own country’s flag\r\nThat’s when they paint freedom and democracy black\r\nJustice and patriotism depend on what side you’re on\r\nWhere you’re from, and better yet who you don’t confront\r\nThis ain’t Greek mythology, we live street reality\r\nWe’re Formosans. We won’t fail like the Trojans\r\nBeating a dead horse is not an option\r\nDecapitation is a sentence more proper than ancient\r\nArm yourself with intelligence and conscience\r\nIt’s time to pick up the blade for self-protection\r\nDemocracy starts with blood and revolution\r\nI’ll claim my trophy over your lamentation', '', 277, '', '張睿銓，李婉菁，岳翰林', '張睿銓', '拷秋勤', '喜瑪拉雅代理發行', '', 1, 1, 0, '2009-12-08 21:34:33', '2015-03-12 13:40:25', '0000-00-00 00:00:00'),
(20009, 572, 2179, 11, '拷秋勤 - 金光閃閃 (莫尚 Emergency Mix)', '此為拷秋勤"金光閃閃"一曲的混音版本', '2009-07-26 00:00:00', 2000, 10, 0, 2, '(客家話：范姜)\r\n騙錢  騙汝介錢\r\n用麼介方法拿汝介錢\r\n一下係國稅局介官員\r\n一下又係教汝賺大錢\r\n\r\n全部清淨淨  毋管汝有幾多錢  還有幾多錢\r\n心中有貪  全部變作佢介錢\r\n有麼介法度  警察也無法度\r\n佢介會員遍布世界各處\r\n\r\n夠毛介人  敗德介事情\r\n毋驚害死人  因為佢無良心\r\n心中毋好有  貪  貪  貪\r\n才毋會被  騙  騙  騙\r\n\r\n詐騙全食一張嘴\r\n利用人性介弱點\r\n欺騙汝介情  欺騙汝介義\r\n因為佢無情無義無心無肝  無人性\r\n\r\n*<副歌>\r\n(華語、客家話、河洛語)\r\n詐騙集團  詐騙集團\r\n毋斯打分捱  捱無貸款\r\n詐騙集團  詐騙集團\r\n咦  汝介聲樣會按怪\r\n詐騙集團  詐騙集團\r\n捱無參加麼介抽獎摸彩\r\n詐騙集團  詐騙集團\r\n汝擱咖乎我  汝就試看嘪\r\n\r\n (河洛語：fishLIN)\r\n食穿毋免操煩  成功就愛靠這擺\r\n免簽樂透六合彩  嘛會當生出千萬財產\r\n什麼景氣歹  是恁自己憨慢\r\n挖一咧窟仔佇這等  黃金自動走入來\r\n\r\n反  詐騙兮廣告  電視嘛不時佇播\r\n但是人兮腦筋毋知按怎嘛攏會秀斗\r\n歹徒  兮手路  是不斷咧進步\r\n一步跟著一步  給汝吸嘎乾枯枯\r\n\r\n喂  王董  恁兒今嘛佇我這\r\n嗚  阿爸阿爸  趕緊來救我\r\n只要五百  (五百)  保恁孝生兮生命\r\n轉帳號碼  我勒圈圈叉叉七七又八八\r\n\r\n等汝發掘事實真相  反悔已經未赴囉\r\n騙子早就走去外國  連警察嘛無法度\r\n一世人撿腸搣肚  只剩一條四角褲\r\n心中萬分痛苦  最後只有去跳淡水河\r\n\r\nRepeat * x 1\r\n\r\n詐騙集團  詐騙集團\r\n汝嘪擱唬爛  嘪擱唬爛\r\n詐騙集團  詐騙集團\r\n汝嘪擱唬爛  嘪擱唬爛\r\n詐騙集團  詐騙集團\r\n汝嘪擱唬爛  嘪擱唬爛\r\n詐騙集團  詐騙集團\r\n不爽的人一起唱出來\r\n\r\nRepeat * x 2', '', 225, '', '拷秋勤，MoShang', '拷秋勤', '拷秋勤', '喜瑪拉雅代理發行', '', 1, 1, 0, '2009-12-08 21:35:16', '2015-03-12 13:40:25', '0000-00-00 00:00:00'),
(20010, 572, 2179, 12, '張睿銓 - 空禪 (TIBETAN MIX featuring 索朗多傑 & 莫尚)', '此為張睿銓"空禪"一曲的混音版本', '2009-07-26 00:00:00', 2000, 10, 0, 2, '(圖博語：索朗多傑)\r\n\r\n(英文：張睿銓)\r\nI''m arrested for a breach of the peace\r\nI''m arrested for a breach of the peace\r\nI''m imprisoned for the truth that I speak\r\nWill be executed for the love that I seek\r\n\r\nMy friend''s a teacher. Sylvie wears this black T-shirt \r\nBought from Reporters without Borders, recorders of marauders\r\nIt''s five handcuffs joined above 2008\r\nPay online, and your shipment arrives in fourteen days\r\nBut when I''m placing an order on this free-speech website \r\nIt''s taken over by the interface in Chinese Simplified\r\nPropaganda''s never simplified, can only be vandalized\r\nI orchestrate lyrical drive-bys\r\nBlacklisted writers ain''t woke up from the abyss\r\nHow much of your justice was purchased by those in mists?\r\nSonic death threats received ''cause she says "Shame on the police"\r\nIntelligence is openly silenced by violence on reprise\r\nRich folks and politicians perform intercourse on TV\r\nMetaphors that tease me accept the passports of them landlords\r\nGranted entry to my country self-willingly spelled backward\r\nThe benumbed wolf in the Arctic licks the blade that protrudes from the snow\r\nSuicide show. Tongue cut, feast of blood, body picked up \r\nBy hunters who hide to maintain the status quo\r\nGunshots heard from the other side of the war zone \r\nThousands of kilos away but near like a ring tone\r\nFreedom of speech becomes a figure of speech, shown \r\nBy the greed of a leech and a dog on a leash\r\n\r\nI''m arrested for a breach of the peace\r\nI''m arrested for a breach of the peace\r\nI''m imprisoned for the truth that I speak\r\nWill be executed for the love that I seek\r\n\r\nAncient mentality created solely by Homo sapiens\r\nPillaging their own kind across space and time \r\nNeither animal nor divine, breathed into your blood\r\nWhether you''re deaf, dumb, or blind\r\nHe who sees from the side has eight eyes\r\nMeditate and transform into the late night\r\nAdmire cherry blossoms from two breaths away\r\nEnter the tea room disarmed and learn the Way\r\nDrink water from the well, elixir for any pain felt\r\nMy steel''s long sheathed so heaven isn''t hell \r\nTriumph is fulfilled when no one''s killed\r\nBut life prevails when it ends. I''m Death himself \r\nTolerance for police brutality in a Zen style\r\nFragrance of mortal sacrifices to defend smiles\r\nOf those women and children who are precious and innocent\r\nWhen traces of murder and terror seem but evident\r\nThe earthquake distracted attention, not a precedent \r\nBut didn''t stop the soldiers from butchering more dissidents\r\nDonations channeled to corruption and military weapons\r\nVengeance is yours, Lord, witnessed with eyes open \r\nReflections of the sun, moon, and stars on the ocean\r\nParadigms are shifting, huh, in constant motion\r\nThey say all the answers are written on the hidden leaves\r\nRead carefully, and you can be truly free\r\n\r\nI''m arrested for a breach of the peace\r\nI''m arrested for a breach of the peace\r\nI''m imprisoned for the truth that I speak\r\nWill be executed for the love that I seek', '', 361, '', '張睿銓，MoShang，DJ Ruler', '張睿銓，索朗多傑', '拷秋勤', '喜瑪拉雅代理發行', '', 1, 1, 0, '2009-12-08 21:36:28', '2015-03-12 13:40:25', '0000-00-00 00:00:00'),
(20011, 572, 2179, 4, '拷秋勤 - 金光閃閃 (Diss-Organized Criminals)', '金錢掛帥，人類因貪念而存在。\r\n\r\n在這個凡事都講求錢的時代，不少人利用了人類的貪性成立了新興行業，那就是詐騙集團，詐騙集團不斷開發各種手法，來自簡訊、電話等各種管道，目的只為了拿到你的錢。一下子可能是國稅局的官員，一下子又可能假裝綁架了你的小孩，或許你自認為不會輕易上當，但只要一個不小心或是一點點的貪念就可以讓你一貧如洗，一輩子的努力都化為烏有，這樣的悲劇不斷在世界各地發生，該有人出來制裁詐騙集團了！\r\n\r\n這首歌我們使用了台灣各大場合最常被使用到的那卡西元素，配合上強烈的節拍，呈現出一種不一樣的那卡西風格，副歌不斷的強調「詐騙集團」四個字，正是提醒你詐騙事件不斷發生，在你暗自高興好似有大把銀子入帳時，也要仔細想想是否正在受騙上當，在這麼一個金錢流通越來越簡單的時代，一定要小心為上，別因一時的貪念賠上了你的一生。\r\n\r\nThere are more and more organized crimes done through modern technology and with various tricks. However, you don’t need to worry if you are not greedy about what does not belong to you.', '2009-07-26 00:00:00', 2000, 10, 0, 2, '(客家話：范姜)\r\n騙錢  騙汝介錢\r\n用麼介方法拿汝介錢\r\n一下係國稅局介官員\r\n一下又係教汝賺大錢\r\n\r\n全部清淨淨  毋管汝有幾多錢  還有幾多錢\r\n心中有貪  全部變作佢介錢\r\n有麼介法度  警察也無法度\r\n佢介會員遍布世界各處\r\n\r\n夠毛介人  敗德介事情\r\n毋驚害死人  因為佢無良心\r\n心中毋好有  貪  貪  貪\r\n才毋會被  騙  騙  騙\r\n\r\n詐騙全食一張嘴\r\n利用人性介弱點\r\n欺騙汝介情  欺騙汝介義\r\n因為佢無情無義無心無肝  無人性\r\n\r\n*<副歌>\r\n(華語、客家話、河洛語)\r\n詐騙集團  詐騙集團\r\n毋斯打分捱  捱無貸款\r\n詐騙集團  詐騙集團\r\n咦  汝介聲樣會按怪\r\n詐騙集團  詐騙集團\r\n捱無參加麼介抽獎摸彩\r\n詐騙集團  詐騙集團\r\n汝擱咖乎我  汝就試看嘪\r\n\r\n (河洛語：fishLIN)\r\n食穿毋免操煩  成功就愛靠這擺\r\n免簽樂透六合彩  嘛會當生出千萬財產\r\n什麼景氣歹  是恁自己憨慢\r\n挖一咧窟仔佇這等  黃金自動走入來\r\n\r\n反  詐騙兮廣告  電視嘛不時佇播\r\n但是人兮腦筋毋知按怎嘛攏會秀斗\r\n歹徒  兮手路  是不斷咧進步\r\n一步跟著一步  給汝吸嘎乾枯枯\r\n\r\n喂  王董  恁兒今嘛佇我這\r\n嗚  阿爸阿爸  趕緊來救我\r\n只要五百  (五百)  保恁孝生兮生命\r\n轉帳號碼  我勒圈圈叉叉七七又八八\r\n\r\n等汝發掘事實真相  反悔已經未赴囉\r\n騙子早就走去外國  連警察嘛無法度\r\n一世人撿腸搣肚  只剩一條四角褲\r\n心中萬分痛苦  最後只有去跳淡水河\r\n\r\nRepeat * x 1\r\n\r\n詐騙集團  詐騙集團\r\n汝嘪擱唬爛  嘪擱唬爛\r\n詐騙集團  詐騙集團\r\n汝嘪擱唬爛  嘪擱唬爛\r\n詐騙集團  詐騙集團\r\n汝嘪擱唬爛  嘪擱唬爛\r\n詐騙集團  詐騙集團\r\n不爽的人一起唱出來\r\n\r\nRepeat * x 2', '', 259, '', '拷秋勤', '拷秋勤', '拷秋勤', '喜瑪拉雅代理發行', '', 1, 1, 0, '2009-12-08 21:37:56', '2015-03-12 13:40:25', '0000-00-00 00:00:00'),
(20012, 21238, 0, 1, '為了將來', '從樂團跳脫出來成為獨立歌手\r\n帶著心裡面的理想朝著自己的目標邁進\r\n勉勵自己放開心胸\r\n過去的事情就讓他成為回憶\r\n有個新的開始\r\n換條跑到重新出發', '2010-02-03 00:00:00', 2000, 0, 2, 1, '帶著心內的理想\r\n看不清方向\r\n是要安怎來向前衝\r\n\r\n站穩我的腳步\r\n面對未來的路\r\n不驚是有多辛苦\r\n\r\n總是要試看看\r\n不通因為驚受到傷害\r\n世間無平穩的路\r\n為了咱的將來\r\n\r\n放開咱的心\r\n麥擱再去懷念過去\r\n為了將來作準備\r\n創造人生的意義\r\n心裡賣空虛\r\n一分一秒攏是金錢\r\n就要活出咱自己\r\n總有一天會出頭天\r\n\r\n在什麼地方\r\n有我的將來', '', 214, '', '林阿德', '林阿德', '', '獨立', '', 0, 0, 1, '2009-12-08 23:17:36', '2013-10-07 17:15:22', '0000-00-00 00:00:00'),
(20013, 21238, 0, 1, '隨風去', '我的第一首個人創作\r\n面對感情難關\r\n有時候還是得放手才看的見未來', '2010-02-03 00:00:00', 2000, 0, 2, 1, '想到那一天(想到咱的過去)\r\n你站在我面頭前(我心內很傷悲)\r\n面對我的感情(整天看未到你)\r\n你卻不能平靜(一秒也未平靜)\r\n\r\n是不是對你的關愛(是不是天公伯注定)\r\n就像大海浪(折磨我的心)\r\n壓住你無法喘氣(壓住我)\r\n才想要離開(心情也未清)\r\n\r\n就給你\r\n隨風去\r\n麥擱因為我來阻礙到你\r\n心\r\n放乎開\r\n用到你的全心全意來證明\r\n創造自己ㄟ未來\r\n不需要愛情\r\n只剩我在這傻傻的等你', '', 240, '', '林阿德', '林阿德', '', '獨立', '', 0, 0, 1, '2009-12-08 23:19:47', '2013-10-07 17:15:22', '0000-00-00 00:00:00'),
(20014, 21238, 0, 1, '未來', '想想人生的因果循環,\r\n上輩子造業必須由這輩子來償還\r\n只有抱持著順其自然逆來順受的心態來面對一切\r\n才會讓自己的人生過的更輕鬆自在\r\n創造自己光明的未來', '0000-00-00 00:00:00', 2000, 0, 2, 7, '一世人造業太多\r\n就愛用後世人來還\r\n不需要計較太多\r\n順其自然才有最好的機會\r\n\r\n不免去想太多\r\n會有光明的出口\r\n分乎清謊話\r\n\r\n摸看看自己的心\r\n是不是還有這麼乾淨\r\n貪心自私的想法\r\n已經看不到穩定的將來\r\n\r\n人生還剩多少\r\n把握所有的機會\r\n選擇正確的路\r\n來完成自己心裡的夢\r\n\r\n麥想太多\r\n這是你的機會\r\n為心愛的人\r\n為了自己的未來\r\n還是在\r\n心操煩\r\n找一個自己的未來', '', 215, '', '', '', '', '獨立', '', 0, 0, 1, '2009-12-08 23:22:31', '2013-10-07 17:15:22', '0000-00-00 00:00:00'),
