keep losing our minds\nFor the place we never go...', '', 253, '', '洪璽開', '洪璽開', '陳品先', 'STAYCOOL', '', 1, 1, 0, '2009-12-08 23:32:39', '2015-03-12 13:40:25', '0000-00-00 00:00:00'),
